import React from "react";
import styled from "styled-components";
import { AircraftList } from "./components/AircraftList";
import { FlightCard } from "./components/FlightCard";
import { flights } from "./utils/data";

const Wrapper = styled.div`
    display: flex;
    align-items: center;
    flex-direction: row;
    justify-content: center;
`;

const List = styled.div`
  padding: 10px;
  width: 200px;
  height: 100px;
`;

type Flight = {
    ident: string,
    departuretime: number,
    arrivaltime: number,
    readableDeparture: string,
    readableArrival: string,
    origin: string,
    destination: string,
}

function App() {

    return (
        <div className="App">
            <div>Header</div>
            <Wrapper>
                <List>
                    Aircrafts
                    <AircraftList />
                </List>
                <List>Rotation</List>
                <List>
                    {flights.map((flight) => (
                        <FlightCard
                            key={flight.ident}
                            ident = {flight.ident} 
                            departuretime = {flight.departuretime} 
                            arrivaltime = {flight.arrivaltime} 
                            readableDeparture= {flight.readableDeparture} 
                            readableArrival= {flight.readableArrival} 
                            origin = {flight.origin} 
                            destination= {flight.destination}
                        />
                    ))}
                </List>
            </Wrapper>
        </div>
    );
}

export default App;
